import React from 'react';
import { PieChart, Pie, Cell } from 'recharts';
import './index.css';

class StageOnelbgroup extends React.Component {




  render() {

    const routerInfoList = [
      { type: "NPU-0", maxEntries: 16384, usedEntries: 2, percentUsage: null, color: '' },
      { type: "NPU-1", maxEntries: 16384, usedEntries: 2, percentUsage: null, color: '' },
      { type: "NPU-2", maxEntries: 16384, usedEntries: 2, percentUsage: null, color: '' },
    ];

    for (let i = 0; i < routerInfoList.length; i++) {
      routerInfoList[i].percentUsage = (routerInfoList[i].usedEntries/routerInfoList[i].maxEntries)*100;
    }


    let redCounter = 0;
    let yellowCounter = 0;
    let greenCounter = 0;

    for (let i = 0; i < routerInfoList.length; i++) {
      if (routerInfoList[i].percentUsage >= 95) {
        routerInfoList[i].color = "red";
        redCounter++;
      }
      if (routerInfoList[i].percentUsage >= 80 && routerInfoList[i].percentUsage < 95) {
	routerInfoList[i].color = "yellow";
        yellowCounter++;
      }
      if (routerInfoList[i].percentUsage >= 0 && routerInfoList[i].percentUsage< 80) {
        routerInfoList[i].color = "green";
	      greenCounter++;
      }
    }

    const data1 = [
      {
        name: 'NPU-0',
        uv: routerInfoList[0].usedEntries,
      }
    ];
    const data2 = [
      {
        name: 'NPU-1',
        uv: routerInfoList[1].usedEntries,
      }
    ];
    const data3 = [
      {
        name: 'NPU-2',
        uv: routerInfoList[2].usedEntries,
      }
    ];

    return (
      <div>
        <div style={ { 'text-align': 'center' } }>
        <h1>stage1_lb_group</h1>
          <BarChart
            width={500}
            height={300}
            data={data1}
            margin={{
              top: 5,
              right: 30,
              left: 20,
              bottom: 5,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="uv" fill="#82ca9d" />
          </BarChart>
          <BarChart
            width={500}
            height={300}
            data={data2}
            margin={{
              top: 5,
              right: 30,
              left: 20,
              bottom: 5,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="uv" fill="#82ca9d" />
          </BarChart>
          <BarChart
            width={500}
            height={300}
            data={data3}
            margin={{
              top: 5,
              right: 30,
              left: 20,
              bottom: 5,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="uv" fill="#82ca9d" />
          </BarChart>
        </div>
      </div>
    )
  }
}

export default StageOnelbgroup;
